import React from 'react';
import styled from 'styled-components';

const MiddleBlock = styled.div`
    div {
        height: 500px;
    }
`

const Middle = () => {
    return (
        <MiddleBlock>
            <div>page1</div>
            <div>page2</div>
            <div>page3</div>
        </MiddleBlock>
    )
}

export default Middle;
